'use strict';
let SendSingleCommandWithoutResponse = require('./SendSingleCommandWithoutResponse.js');
let stdlib = require('@gehtsoft/LuaxStdlib-node').stdlib;
class GetOrdersCommand extends SendSingleCommandWithoutResponse {
    acctId;
    constructor() {
        super();
        this.commandName = "GetOrdersCommand";
    }
    createTransportMessage() {
        return this.messageFactory.createGetOrdersRequestMessage(this.tradingSession, this.acctId, this.requestNumberGenerator, stdlib.nowutc());
    }
}
module.exports = GetOrdersCommand
